#include <iostream>
#include <string>

using namespace std;

int main() {
    
  string big_num = "";
  
  int big_num_len = big_num.length();
  long result = 0;
  
  for (int i = 0; i < big_num_len; i++)
  {
    int parsed_num = big_num[i] - '0';
      
    result += parsed_num;
  }
  
  cout << result;
  
  return 0;
  
}
